sys.setrecursionlimit(100000)

def extended_gcd(a, b):
    if b == 0:
        return a, 1, 0
    else:
        d, x, y = extended_gcd(b, a % b)
        return d, y, x - (a // b) * y

def solve_mod_equation3(n, t):
    d, x, y = extended_gcd(3, n)
    if t % d != 0:
        return None  # 无解
    x0 = (x * (t // d)) % n
    return x0

def solve_mod_equation(x1, n, t):
    d, x, y = extended_gcd(x1, n)
    if t % d != 0:
        return None  # 无解
    x0 = (x * (t // d)) % n
    return x0

# 求解 x
